import React from 'react';
import DayMenu from '../daymenu/DayMenu';
import './WeekMenu.css';

const weekMeals = [
  {
    day: 'Понедельник',
    meals: [
      { src: '/path/to/image1.jpg', title: 'Завтрак', description: 'Описание завтрака' },
      { src: '/path/to/image2.jpg', title: 'Обед', description: 'Описание обеда' },
      { src: '/path/to/image3.jpg', title: 'Ужин', description: 'Описание ужина' },
    ],
  },
  {
    day: 'Вторник',
    meals: [
      { src: '/path/to/image4.jpg', title: 'Завтрак', description: 'Описание завтрака' },
      { src: '/path/to/image5.jpg', title: 'Обед', description: 'Описание обеда' },
      { src: '/path/to/image6.jpg', title: 'Ужин', description: 'Описание ужина' },
    ],
  },
  // Добавьте оставшиеся дни недели аналогично
];

const WeekMenu = () => {
  return (
    <div className="week-menu">
      {weekMeals.map((dayMeal, index) => (
        <DayMenu key={index} day={dayMeal.day} meals={dayMeal.meals} />
      ))}
    </div>
  );
};

export default WeekMenu;
